BEGIN TRANSACTION;
CREATE TABLE "schema_migrations" ("version" text NOT NULL);
CREATE TABLE "pieces" ("id" SERIAL PRIMARY KEY NOT NULL, "count" integer, "length_ins" float, "width_ins" float, "height_ins" float, "stackability" integer, "weight_lbs" float, "volume_cuft" float, "shipment_id" integer, "created_at" timestamp, "updated_at" timestamp, "piece_name" text, "gross_volume_cuft" float, "gross_weight_lbs" float, "piece_cb_util" float, "piece_wt_util" float, "piece_max_su" integer, "piece_lqcb_util" float);
CREATE TABLE "users" ("id" SERIAL PRIMARY KEY NOT NULL, "email" text DEFAULT '' NOT NULL, "encrypted_password" text DEFAULT '' NOT NULL, "reset_password_token" text, "reset_password_sent_at" timestamp, "remember_created_at" timestamp, "sign_in_count" integer DEFAULT 0 NOT NULL, "current_sign_in_at" timestamp, "last_sign_in_at" timestamp, "current_sign_in_ip" text, "last_sign_in_ip" text, "created_at" timestamp, "updated_at" timestamp, "shipments_count" integer);
CREATE TABLE "shipments" ("id" SERIAL PRIMARY KEY NOT NULL, "pieces_count" integer, "gross_weight_lbs" float, "gross_volume_cuft" float, "wt_util" float, "cb_util" float, "created_at" timestamp, "updated_at" timestamp, "user_id" integer, "lqcb_util" float, "equipment_id" integer, "name" text);
CREATE TABLE "equipment" ("id" SERIAL PRIMARY KEY NOT NULL, "equip_name" text, "description" text, "mode" text, "wt_limit_lbs" float, "cb_limit_cuft" float, "length1_ins" float, "width1_ins" float, "height1_ins" float, "length2_ins" float, "width2_ins" float, "height2_ins" float, "length3_ins" float, "width3_ins" float, "height3_ins" float, "created_at" timestamp, "updated_at" timestamp, "equip_image_file_name" text, "equip_image_content_type" text, "equip_image_file_size" integer, "equip_image_updated_at" timestamp, "do_not_delete" boolean DEFAULT 0);
CREATE UNIQUE INDEX "unique_schema_migrations" ON "schema_migrations" ("version");
CREATE UNIQUE INDEX "index_users_on_email" ON "users" ("email");
CREATE UNIQUE INDEX "index_users_on_reset_password_token" ON "users" ("reset_password_token");
COMMIT;
